import React from "react";
import { BrowserRouter as Router,Route,Link,Redirect} from "react-router-dom";
export default class BloodRequest extends React.Component {
  render() {
    return (
      <React.Fragment>
        <p>{this.props.bloodRequest.username}</p>
        <p>{this.props.bloodRequest.reason}</p>
        <Link to={"/bloodRequest/"+this.props.bloodRequest.id}><button>View Detail</button></Link>
        <hr />
      </React.Fragment>
    );
  }
}
